import React from 'react';
import Carousello from './Carousel';
import DeckCard from './DeckCard';

function HomePage(){
    return(
        <div className="HomePage">
            <div className="col">
                <div className="row h-50 w-100">
                    <Carousello/>
                </div>
            </div>    
            <br/>
            <div>
                <DeckCard/>
            </div>
        </div>
    );
}

export default HomePage;
